import React, { useState } from "react";
import {
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
  } from "reactstrap";
  import { useTranslation } from 'react-i18next';

  import LanguageSwitcher from './LanguageSwitcher/index';
  import brazilianflag from '../images/brazilflag.png';
  import spanishflag from '../images/spanishflag.png';
  import usaflag from '../images/usaflag.png';

  const Topbar = props => {
    const [isOpen, setIsOpen] = useState(false);

    const toggle = () => setIsOpen(!isOpen);

    const { t } = useTranslation();

    return (
      <div>
        <Navbar color="none" light expand="md">
          <NavbarBrand class="navbar-brand" href="#">
          <img src="../../public/newLogo.png" alt="" width="100" height="35"/>
          </NavbarBrand>
          <NavbarToggler onClick={toggle} />
          <Collapse isOpen={isOpen} navbar>
            <Nav className="justify-content-center" style={{ flex: 1}}>
              <NavItem > 
                <NavLink href="/components/" className='text-muted'>{t('description.nav1')}</NavLink>
                </NavItem>
                <NavItem>
                <NavLink href="/components/" className='text-muted'>{t('description.nav2')}</NavLink>
              </NavItem>



            </Nav>
            <div class="btn-group pull-right" role="group" aria-label="Basic example">
            <LanguageSwitcher />
                {/* <button type="button" class="btn"><img src={brazilianflag} height={30} width={30} style={{borderRadius: "40%"}} /></button>
                <button type="button" class="btn"><img src={spanishflag} height={6} width={20} /></button>
                <button type="button" class="btn"><img src={usaflag} height={6} width={20} /></button> */}
            </div>
          </Collapse>
        </Navbar>
      </div>
    );
  };

  export default Topbar;
